INSERT INTO `question_list` VALUES (98,'test01','나머지정리 문제입니다 어렵네요','직접 구하려니 너무 복잡하네요..\n다른방법 없을까요?','http://218.150.182.58:2041/mas/uploads/test01/20160926_014907_HDR.jpg','나머지정리',NULL,6,'2016-09-25 18:01:52',24,1,1),(100,'jjo6164','유리함수와 무리함수 관련','정의에 입각한 문제인데 \n각 보기별로 설명해주세요..','http://218.150.182.58:2041/mas/uploads/jjo6164/20160926_015727_HDR-1.jpg','유리함수와무리함수',NULL,6,'2016-09-25 23:41:46',11,1,1),(101,'jjo6164','rr','자세하게 풀어주세요 ','http://218.150.182.58:2041/mas/uploads/jjo6164/Screenshot_2016-09-26-08-52-03-1.png','삼각함수',NULL,5,'2016-09-26 00:01:30',11,1,0),(102,'test02','원의방정식 문제입니다','어떻게.풀이하나요','http://218.150.182.58:2041/mas/uploads/test02/20160926_100930_HDR-1.jpg','원의방정식',NULL,4,'2016-09-26 01:11:42',27,1,1),(103,'jjo6164','순열 질문합니다','어떻게푸나요','http://218.150.182.58:2041/mas/uploads/jjo6164/20160926_101523_HDR-1.jpg','순열과조합',NULL,4,'2016-09-26 01:16:45',10,2,2),(104,'jjo6164','자연수의 합 순열문제','양의약수가 짝수개인 자연수를 어떻게 구하나요?','http://218.150.182.58:2041/mas/uploads/jjo6164/20160926_102242_HDR-1.jpg','순열과조합',NULL,6,'2016-09-26 01:24:57',20,1,1),(105,'test01','조합문제입니다','조합','http://218.150.182.58:2041/mas/uploads/test01/20160926_104258_HDR-1.jpg','순열과조합',NULL,3,'2016-09-26 01:44:27',25,3,1),(106,'test01','통계적추정 문제','설명하면서 풀어주세요','http://218.150.182.58:2041/mas/uploads/test01/20160926_105045_HDR-1.jpg','통계적추정,통계',NULL,7,'2016-09-26 01:52:05',32,1,1),(107,'test02','원의방정식','풀어주세요\n보기가 약간짤렸네요 \n','http://218.150.182.58:2041/mas/uploads/test02/20160926_111407_HDR-1.jpg','원의방정식',NULL,6,'2016-09-26 02:18:00',55,1,1),(115,'jjo6164','적분문제입니다','무한급수 적분인데\n도와주세요!','http://218.150.182.58:2041/mas/uploads/jjo6164/1474990434189.png','적분,미분,정적분',NULL,5,'2016-09-27 15:35:56',48,4,2),(116,'test01','로그함수와 적분입니다','어려워요','http://218.150.182.58:2041/mas/uploads/test01/1474991022480.png','적분,함수,지수함수와로그함수',NULL,6,'2016-09-27 15:45:09',47,4,3),(117,'jhh1117','적분을 이용한 계산문제','그래프와 적분 관련 문제입니다','http://218.150.182.58:2041/mas/uploads/jhh1117/1474991805317.png','적분,함수와그래프,함수의극한과연속',NULL,8,'2016-09-27 15:59:14',34,2,0),(118,'jjo6164','지수함수와 로그함수 관련 문제입니다','질문이요~','http://218.150.182.58:2041/mas/uploads/jjo6164/1474994232324.png','지수함수와로그함수,지수와로그,방정식과부등식',NULL,6,'2016-09-27 16:38:19',47,5,2),(119,'jjo6164','지수,로그함수 기본문제입니다','풀어주세요','http://218.150.182.58:2041/mas/uploads/jjo6164/1474994854676.png','지수함수와로그함수,지수와로그,함수',NULL,4,'2016-09-27 16:48:49',38,4,4),(120,'jjo6164','함수와 그래프 문제','질문합니다','http://218.150.182.58:2041/mas/uploads/jjo6164/1474998111690.png','함수와그래프,이차함수와그래프,이차곡선,함수,일차함수와그래프',NULL,2,'2016-09-27 17:43:08',45,4,2),(121,'jjo6164','확률과통계 경우의수입니다','풀어주세요','http://218.150.182.58:2041/mas/uploads/jjo6164/1474998644280.png','확률과통계,경우의수,통계적추정,순열과조합',NULL,5,'2016-09-27 17:51:24',56,4,3),(122,'jhh1117','도표에 대한 확률 문제입니다','비교적 쉬운 난이도의 문제입니다','http://218.150.182.58:2041/mas/uploads/jhh1117/23.png','확률과통계,통계적추정',NULL,3,'2016-09-28 03:43:31',9,1,0),(124,'jhh1117','test','test','http://218.150.182.58:2041/mas/uploads/jhh1117/1475039005919.jpg','확률과통계',NULL,1,'2016-09-28 07:22:59',3,1,0);
